var $bm_rt;
var compW, compH, layerW, layerH, ratioW, ratioH, layerWUpdated, scaleNew, scaleNew;
compW = 1640;
compH = 1640;
layerW = thisLayer.sourceRectAtTime().width;
layerH = thisLayer.sourceRectAtTime().height;
ratioW = $bm_div(compW, layerW);
ratioH = $bm_div(compH, layerH);
layerWUpdated = $bm_mul(layerW, ratioH);
if (layerWUpdated > compW) {
    scaleNew = $bm_mul(100, ratioH);
} else {
    scaleNew = $bm_mul(100, ratioW);
}
$bm_rt = [
    scaleNew,
    scaleNew
];
